import React from 'react';
import { Drawer, List, ListItem, ListItemText, IconButton } from '@mui/material';
import { Link } from 'react-router-dom';
import ChevronLeftIcon from '@mui/icons-material/ChevronLeft';

const Sidebar = ({ open, toggleSidebar }) => {
    return (
        <Drawer variant="temporary" open={open} onClose={toggleSidebar} ModalProps={{ keepMounted: true }}>
            <IconButton onClick={toggleSidebar} sx={{ alignSelf: 'flex-end' }}>
                <ChevronLeftIcon />
            </IconButton>
            <List>
                <ListItem button component={Link} to="/dashboard">
                    <ListItemText primary="Dashboard" />
                </ListItem>
                <ListItem button component={Link} to="/players">
                    <ListItemText primary="Players" />
                </ListItem>
                <ListItem button component={Link} to="/auctions">
                    <ListItemText primary="Auctions" />
                </ListItem>
            </List>
        </Drawer>
    );
};

export default Sidebar;
